import React  from 'react';

export class Header extends React.Component {
    render() {
        return(
            <nav className='navbar'>
                <div className='container'>
                    <div className='navbar-header'>
                        <ul>
                            <li><a href='#'>Home</a></li>
                        </ul>
                    </div>
                </div>
            </nav>
        ); 
    }
}
